import React from 'react'
import QuoteList from '../components/quotes/QuoteList'
const DUMMY_QUOTES = [
  {
    id: 'q1',
    author: 'Shakespeare',
    text: 'Paçocaaaaaaaaaa'
  },
  {
    id: 'q2',
    author: 'Shakespeare',
    text: 'Queijoooooooo'
  }
]

const AllQuotes = () => {
  return (
    <>
    <h1>AllQuotes</h1>
    <QuoteList quotes={DUMMY_QUOTES}/>
    </>
    
  )
}

export default AllQuotes
